import React, { useEffect, useState } from 'react';
import { useSwipeable } from 'react-swipeable';
import './UserPageFeatures.css';
import PodcastCarousel from "../CarouselHome/Carousel";
import PodcastCardTest from '../PodcastCard/PodcastCarouselCard';

function Following () {
    return (
        <div className='savedforlatercontainer'>
            <div className='savedtitle'>
                <h1 className='usertitles'>Saved for Later</h1>
                <p className='usersubtitles'>You wanted to make sure you returned to these...</p>
            </div>
            <div>
            <PodcastCarousel>
                <PodcastCardTest/>
            </PodcastCarousel>
            </div>
        </div>
    );
}

export default Following;
